import react from 'react';
import Button  from '../../container/button';
import '.styles.scss';

interface allDivPlayer {
    beeingPlaying: boolean
}

const AllDivPlayer = ({ beeingPlaying}: allDivPlayer) => (
    <div className='allDivPlayer'>
    {!beeingPlaying && <Button buttonName={'begin'} buttonClass={'allDivPlayer'} functionOnClick={'begin()'}/>}
    </div>
)
export default AllDivPlayer
